import "./ToolForm.css";

const ToolForm = () => {
  return (
    <div>
      <div style={{ width: "45%", marginLeft: "27.5", marginRight: "27.5" }}>
        <h2>TITLE</h2>
        <Form.Control type="text" placeholder="placeholder" />
        <h2>ARTIST</h2>
        <Form.Control type="text" placeholder="placeholder" />
        <h2>ISRC</h2>
        <Form.Control type="text" placeholder="placeholder" />
        <h2>ISWC</h2>
        <Form.Control type="text" placeholder="placeholder" />
      </div>
    </div>
  );
};

export default ToolForm;
